!function(e){try{e=angular.module("veasy.calendar")}catch(a){e=angular.module("veasy.calendar",[])}e.run(["$templateCache",function(a){a.put("veasy-calendar.html",'<div class=vcalendar><div class=vcalendar-header><button class="btn btn-default" ng-click=previousMonth()><i class="fa fa-angle-left vcalendar-arrow"></i></button> <span>{{calendar.title}}</span> <button class="btn btn-default" ng-click=nextMonth()><i class="fa fa-angle-right vcalendar-arrow"></i></button></div><div class=vcalendar-body><div class=vcalendar-header-row><div class=vcalendar-header-col ng-repeat="day in calendar.weekDays"><span>{{day}}</span></div></div><div class=vcalendar-body-row ng-repeat="week in calendar.weeks"><div class=vcalendar-body-col ng-class="{ \'vcalendar-today\': day.isToday, \'vcalendar-weekend-day\': day.isWeekend, \'vcalendar-is-not-current-month-day\': !day.isCurrentMonth }" ng-repeat="day in week" ng-click=onClickDay()><span class=vcalendar-day ng-class="{ }">{{day.day}}</span><div style="overflow: auto; flex-grow: 1;max-height: 67px;padding-top: 2px;"><div class=vcalendar-event ng-click="onClickEvent($event, event)" ng-style="{ \'background-color\': event.color }" ng-repeat="event in day.events"><span class=vcalendar-util-truncate>{{event[getEventTitle()]}}</span> <span>{{getEventTime(event.startDate, event.endDate)}}</span></div></div></div></div></div><div class=vcalendar-footer></div></div>')}])}();